import axios from 'axios';

export const getWords = async (user, id) => {
  const url = `http://localhost:3000/cards/${id}`;
  console.log(url);
  return await axios.get(url, { user: user, id: id }, { withCredentials: true })
    .then(function (response) {
      console.log(response);
      return response;
    })
    .catch(function (error) {
      console.log(error);
    });
}
